@keveman  Thanks, the so is built on another ubuntu platform, and I miss this problem when using the so on centos, after rebuilding auc.so now every thing is Ok.
Another thing, might worth a look, in order to gen auc.so, I need to first install google protobuffer, then, I need to add below to my ~/.bashrc for a workaround for missing eigen related headers.
export CPLUS_INCLUDE_PATH=~/.cache/bazel/_bazel_gezi/90eddd4c58c33600d0766ab4c9609dbb/external/eigen_archive/:~/.cache/bazel/_bazel_gezi/90eddd4c58c33600d0766ab4c9609dbb/external/eigen_archive/eigen-eigen-70505a059011:~/.cache/bazel/_bazel_gezi/90eddd4c58c33600d0766ab4c9609dbb/external/tf/third_party/:~/other/tensorflow/
